/*!50003 CREATE*/ /*!50017 DEFINER=`avnadmin`@`%`*/ /*!50003 TRIGGER `after_expense_insert` AFTER INSERT ON `Expense` FOR EACH ROW BEGIN
    DECLARE total_expenses DECIMAL(24,2);
    DECLARE total_revenue DECIMAL(24,2);
    DECLARE profit DECIMAL(24,2);
    DECLARE done INT DEFAULT FALSE;
    DECLARE manager_user_id CHAR(36);
    
    -- cursor to iterate through all managers for this business
    DECLARE manager_cursor CURSOR FOR
        SELECT userId
        FROM Employee
        WHERE businessId = NEW.businessId
          AND accessLevel = 'manager'
          AND userId IS NOT NULL
          AND terminationDate IS NULL
          AND deletedAt IS NULL;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    -- calculate total expenses in last 30 days
    SELECT COALESCE(SUM(cost), 0)
    INTO total_expenses
    FROM Expense
    WHERE businessId = NEW.businessId
      AND purchaseDate >= DATE_SUB(NOW(), INTERVAL 30 DAY)
      AND deletedAt IS NULL;
    
    -- calculate total revenue in last 30 days
    SELECT COALESCE(SUM(amount), 0)
    INTO total_revenue
    FROM Transaction
    WHERE businessId = NEW.businessId
      AND deletedAt IS NULL
      AND purchaseDate >= DATE_SUB(CURDATE(), INTERVAL 30 DAY);
    
    -- calculate profit
    SET profit = total_revenue - total_expenses;
    
    -- if profit is negative, notify all managers
    IF profit < 0 THEN
        OPEN manager_cursor;
        
        read_loop: LOOP
            FETCH manager_cursor INTO manager_user_id;
            
            IF done THEN
                LEAVE read_loop;
            END IF;
            
            -- insert notification for this manager
            INSERT INTO Notification (notificationId, userId, content, sentAt)
            VALUES (
                UUID(),
                manager_user_id,
                CONCAT('Alert: Business profit is negative ($', FORMAT(profit, 2), ') for the last 30 days. Total Revenue: $', FORMAT(total_revenue, 2), ', Total Expenses: $', FORMAT(total_expenses, 2)),
                NOW()
            );
        END LOOP;
        
        CLOSE manager_cursor;
    END IF;
END */;;
DELIMITER ;
