INSERT INTO `Habitat` VALUES ('62f3a93c-2268-427c-a6ab-3faced271fa5','Volcano','Nothing lives here lol','2025-11-22',NULL,'Like, really hot','It\'s hot','A pyroclastic flow is a fast-moving current of hot gas, ash, and volcanic rock that travels down the slopes of a volcano during an explosive eruption. These flows are among the most dangerous volcanic hazards due to their extreme temperatures, high speeds, and destructive power.'),('6e855aa2-7f4d-4a49-ad90-cc7b6510d23c','Chernobyl','akfnsfs jsgnsdgjdf dhdfh','2025-11-23',NULL,NULL,'Inhospitable ',NULL),('838289fc-0146-4557-8da9-44ef337cf3bf','Test2','Testing Habitat','2025-11-11','','','blah','blah, blah blah blah!'),('978c85b8-1c8e-45da-b489-4e2398dfe163','SomeAddedHabitat','N/A','2025-10-27',NULL,NULL,NULL,NULL),('aa66e90a-dba8-4b37-ac8f-e98a788f317e','Testinggg','some place on earth','2025-10-31',NULL,NULL,NULL,NULL),('ba199585-5c82-4a0b-b666-4ad103f6c0e3','hmmm','hmmm','2025-11-23',NULL,NULL,NULL,NULL),('bd4fe946-2f5e-4bef-8db1-f665ecbb7b5a','deserrt ','huh','2025-11-11','','','',''),('caf52b0b-6d81-4d03-af09-d9167d42342c','Desert','fg','2025-11-11',NULL,NULL,NULL,NULL),('cb0ecd76-685b-4fde-9a8e-bb437233f50e','forest','df','2025-11-11',NULL,NULL,NULL,NULL),('e394bffd-d415-4437-a31f-b6e0cb88071e','Desert ','hg','2025-11-11',NULL,NULL,NULL,NULL),('f0a76d05-b091-11f0-ad5e-0a36fd72b752','African Savannah','Grassy plains dotted with acacia trees. Home to lions, zebras, and giraffes.',NULL,'https://images.unsplash.com/photo-1535940360221-641a69c43bac?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2066','Our African Savanna exhibit recreates the wide grasslands of Africa with open views for giraffes, zebras, and antelopes. Visitors can watch lions resting on rock outcrops and observe natural behaviors in a shared space designed for animal safety and comfort.','Warm and dry with gentle breezes and open sunlight throughout the day.','Giraffes only need about 30 minutes of sleep per day, often standing up! Added Fact'),('f0a7879b-b091-11f0-ad5e-0a36fd72b752','Tropical Rainforest','Dense canopy and lush greenery housing parrots, monkeys, and frogs.',NULL,'https://images.unsplash.com/photo-1697350978674-4b40261b0dc3?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2070','Step into the Rainforest Habitat, a warm, humid enclosure filled with lush plants, waterfalls, and vibrant wildlife. Guests can see colorful parrots, playful monkeys swinging through the trees, and exotic frogs in a climate-controlled environment.','Humid with daily misting to mimic tropical rainfall and 80 F temperatures.','More than half of all known animal species live in tropical rainforests.'),('f0a78a0e-b091-11f0-ad5e-0a36fd72b752','Arctic Tundra','Cold, windswept plains where arctic foxes and caribou thrive.',NULL,'https://images.unsplash.com/photo-1515133997814-e6460be24073?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2071','The Arctic Tundra exhibit brings the chill of the polar north to the zoo. It features large rock formations, snow-like flooring, and chilled pools where animals like arctic foxes and reindeer can stay cool while visitors learn about cold-climate adaptations.','Kept below 45 F with snow machines and cool breezes.','Arctic foxes can survive temperatures as low as 58 F thanks to their dense fur.'),('f0a78acc-b091-11f0-ad5e-0a36fd72b752','Coastal Wetlands','Shallow pools and marsh grasses supporting otters, herons, and amphibians.',NULL,'https://images.unsplash.com/photo-1627414879472-802bb4deab90?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2070','Our Coastal Wetlands area includes shallow ponds and flowing streams that mimic real marshes. Otters dive and play through underwater viewing windows, while herons and amphibians live among the reeds in a naturally filtered water system.','Cool and humid with light mist and gentle water sounds.','Wetlands filter pollutants and provide homes for nearly half of all bird species.'),('f0a78b72-b091-11f0-ad5e-0a36fd72b752','Mountain Highlands','Steep cliffs and rocky slopes where snow leopards and mountain goats live.',NULL,'https://images.unsplash.com/photo-1494806812796-244fe51b774d?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2067','The Mountain Highlands habitat simulates a rugged alpine landscape. It has rocky cliffs for snow leopards to climb and cool shaded areas for mountain goats to graze, giving visitors a close-up view of life at high elevations.','Cool and breezy with artificial rock faces and shaded ledges.','Snow leopards can leap up to 50 feet in a single bound!'),('f0a78c17-b091-11f0-ad5e-0a36fd72b752','Coral Reef','Vibrant underwater worlds teeming with fish, coral, and sea turtles.',NULL,'https://images.unsplash.com/photo-1583212292454-1fe6229603b7?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=1674','In the Coral Reef Aquarium, guests can explore the underwater beauty of coral ecosystems through large panoramic tanks. Colorful fish, sea turtles, and living coral structures thrive in a precisely balanced saltwater environment.','Warm 78 F water with bright reef lighting and gentle currents.','Coral reefs cover less than 1% of the ocean but support 25% of marine life.'),('f0a78cb9-b091-11f0-ad5e-0a36fd72b752','Grasslands','Wide open plains with tall grasses where elephants and antelopes roam.',NULL,'https://images.unsplash.com/photo-1496886180343-458a02cc3346?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2074','The Grasslands exhibit offers a spacious outdoor enclosure where elephants and antelopes move freely across open plains. Elevated viewing decks let guests safely observe these large animals in a recreated natural setting.','Sunny with mild winds and occasional misting for cooling.','Elephants communicate through low-frequency rumbles that travel long distances.'),('f0a78da5-b091-11f0-ad5e-0a36fd72b752','Temperate Forest','Deciduous and conifer trees with deer, bears, and diverse birdlife.',NULL,'https://images.unsplash.com/photo-1542202229-7d93c33f5d07?ixlib=rb-4.1.0&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&q=80&w=2070','Our Temperate Forest habitat features cool, shaded woodlands with dense trees and winding trails. Black bears, deer, and owls live here in carefully managed spaces designed to resemble a North American forest.','Mild temperatures with filtered sunlight and seasonal leaf color changes.','Black bears are excellent tree climbers and can run up to 30 mph.'),('f44440d6-17d4-4934-b4e7-ff95f19532f2','NEW HAB!','example','2025-11-11',NULL,'test','Idrk it\'s kinda cold i guess?','test');
