/*!50003 CREATE*/ /*!50017 DEFINER=`avnadmin`@`%`*/ /*!50003 TRIGGER `after_medical_record_insert` AFTER INSERT ON `MedicalRecord` FOR EACH ROW BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE zookeeper_user_id CHAR(36);
    
    -- Cursor to iterate through all zookeepers caring for this animal
    DECLARE zookeeper_cursor CURSOR FOR
        SELECT e.userId
        FROM TakesCareOf tco
        JOIN Employee e ON tco.employeeId = e.employeeId
        WHERE tco.animalId = NEW.animalId
          AND e.userId IS NOT NULL
          AND e.terminationDate IS NULL
          AND e.deletedAt IS NULL;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    -- Only proceed if there are veterinarian notes
    IF NEW.veterinarianNotes IS NOT NULL AND LENGTH(NEW.veterinarianNotes) > 0 THEN
        OPEN zookeeper_cursor;
        
        read_loop: LOOP
            FETCH zookeeper_cursor INTO zookeeper_user_id;
            
            IF done THEN
                LEAVE read_loop;
            END IF;
            
            -- Insert notification for this zookeeper
            INSERT INTO Notification (notificationId, userId, content, sentAt)
            VALUES (
                UUID(),
                zookeeper_user_id,
                CONCAT('New medical record for animal (ID: ', NEW.animalId, '). Veterinarian Notes: ', NEW.veterinarianNotes),
                NOW()
            );
        END LOOP;
        
        CLOSE zookeeper_cursor;
    END IF;
END */;;
